Data Collection&#13;
The final dataset was built from initial data downloaded from NPSpecies, which consisted of 4,198 amphibian records as of 01 March 2021. We performed an initial validation which consisted of spending approximately 1 hour per park unit cross-checking the NPSpecies data against primary literature, reports, theses, range maps, and verified iNaturalist observations. Each record was given a hyperlink to a reference as well as any relevant notes about the record or citation. After initial verification, the dataset was taxonomically normalized in accordance with ITIS. All subspecies designations and non-standard nomenclature was retained in the “ParkSynonyms” field.  &#13;
Records which lacked specificity (only family- or genus-level information provided) were deleted, as well as any obviously false or unverifiable observations (e.g., where a species was recorded well outside of its published range). Upon taxonomic normalization and initial dataset cleaning, we contacted regional subject matter experts to perform a final verification and comment on observations specific to their region. Finally, each record was assigned a conservation status. The global rank (GRank) and state rank (SRank) were based on NatureServe data, as well as a the previously mentioned status based on the IUCN Red List. To aid in management, each dataset entry was also given a field to denote its assignment to one of the 32 NPS Inventory and Monitoring Networks.

Technical Validation&#13;
The verified dataset underwent considerable technical validation. Initial verification was performed by the first two authors of this manuscript, spending approximately 1 hour per park obtaining references for each record within the dataset. Next, the following steps were used to improve dataset quality and comparability: (1) records with “absent” occurrence data and no verifiable references to the contrary were removed, as absent data can be misleading and are rarely reported in occurrence datasets; (2) records with no species-level information were removed; (3) record taxonomy was normalized to ITIS valid species names as of 2022; (4) any missing information for each original record was added (i.e. some original records were missing values in fields such as nativeness, GRank, SRank, common names, etc); and (5) species occurrence records were cross-checked with known range maps. Range maps are well known to overestimate species distributions. Any park with a species records outside the known range map was scrutinized to either reclassify the species to accurately reflect the range or remove the record entirely. For example, most NPS park units in the western United States still list Ambystoma tigrinum as the tiger salamander species present. While these parks do have tiger salamanders, the western tiger salamander has been known as Ambystoma mavortium for at least the last 20 years. &#13;
As a final technical verification, regional subject matter experts were asked to provide comments and verify each record relevant to their geography. As a final check, the verified dataset was compared back to the original NPSpecies records, noting all discrepancies and changes (Fig. 3). For example, for the 2,665 species occurrence records in NPSpecies “Present” category, 2,437 were also classified as Present within the verified, updated dataset. However, for the remaining Present records in the updated dataset, 88 records were originally classified as Possibly Present, 33 records were originally classified as Not in the Park, 109 records were originally unclassified (either unconfirmed or not given a designation), and 76 new records were added. Also, instead of the original intermediate classification of Probably Present, which indicates some significant likelihood that is difficult to represent by occurrence data, we use the more neutral term Possible. All these updates and technical validations align with best practices employed in other large occurrence datasets.&#13;
